import Todos from "./components/Todos";
import React from "react";
import "./App.css";

class App extends React.Component {
  state = {
    todos: [
      {
        id: 1,
        tittle: "gör nåt",
        completed: false,
      },
      {
        id: 2,
        tittle: "rasta hunden",
        completed: false,
      },

      {
        id: 3,
        tittle: "äta nåt",
        completed: false,
      },
    ],

    TodoItem: [
      {
        id: 1,
        tittle: "dricka nåt",
        completed: false,
      },
    ],
  };
  render() {
    return <Todos todos={this.state.todos} />;
    return <TodoItem TodoItem={this.state.TodoItem} />;
  }
}
export default App;
